function rad(deg){
	//console.log("Rad: " + deg * Math.PI / 180 + " deg: " + deg);
	return deg * Math.PI / 180;
}

function resize(x, y){
	//console.log("resizing to [" + x + " " + y + "]");
	c.width = x;
	c.height = y;
}

function dist(a, b){
	x = (a[0]-b[0]);
	x *= x;
	y = (a[1]-b[1]);
	y *= y;
	return Math.sqrt(x+y);
}

function line_circle_collision(Ax, Ay, Bx, By, Cx, Cy, Cr){
	var Ax = Ax - Cx;
	var Ay = Ay - Cy;
	var Bx = Bx - Cx;
	var By = By - Cy;
	var dx = Bx-Ax;
	var dy = By-Ay;
	var dr = Math.sqrt(dx*dx+dy*dy);
	var d = Ax*By-Bx*Ay;
	var i = Cr*Cr*dr*dr-d*d;
	if(i < 0){
		return false;
	}
	return true;
}

